import React from 'react';

const ShowTodoList = ({ todos }) => {
  console.log("Tareas recibidas:", todos);  // Verifica si las tareas están llegando correctamente

  return (
    <div>
      <h1>Lista de Tareas</h1>
      {todos.length > 0 ? (
        <ul>
          {todos.map((todo) => (
            <li key={todo._id}>
              <h2>{todo.title}</h2>
              <p>{todo.description}</p>
              <p>Prioridad: {todo.priority}</p>
              <p>{todo.done ? 'Completado' : 'Pendiente'}</p>
            </li>
          ))}
        </ul>
      ) : (
        <p>No hay tareas disponibles.</p>
      )}
    </div>
  );
};

export default ShowTodoList;
